import React from 'react';
import './styles.css';

const Header = () => (
    <header className="main-header">
        <svg width="30" height="30" viewBox="0 0 30 30" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M19.5 8.25V0H10.5V8.25L15 12.75L19.5 8.25ZM8.25 10.5H0V19.5H8.25L12.75 15L8.25 10.5ZM10.5 21.75V30H19.5V21.75L15 17.25L10.5 21.75ZM21.75 10.5L17.25 15L21.75 19.5H30V10.5H21.75Z" fill="#00D4FF" />
        </svg>
    </header>
);

export default Header;
